pragma solidity 0.5.12;
import "./IPrivateCompany.sol";

interface IPrivateCompanyFactory {event __CoverageIPrivateCompanyFactory(string fileName, uint256 lineNumber);
event __FunctionCoverageIPrivateCompanyFactory(string fileName, uint256 fnId);
event __StatementCoverageIPrivateCompanyFactory(string fileName, uint256 statementId);
event __BranchCoverageIPrivateCompanyFactory(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageIPrivateCompanyFactory(string fileName, uint256 branchId);
event __AssertPostCoverageIPrivateCompanyFactory(string fileName, uint256 branchId);

    event newCompanyCreated(address indexed owner, address indexed company);
    function newCompany(address intendedOwner, string calldata name, string calldata symbol) external returns (address);
}
